      "next_steps": "由于字符串分析有限，建议进行深度代码分析：1. 使用 Radare2 反编译二进制以识别函数逻辑和数据流；2. 委托函数分析以追踪污点传播；3. 检查与其他组件（如 NVRAM 或环境变量）的交互。"
